import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Nav from "./Action/Nav"
import CutData from './Components/CutData'
import Data from './Components/Data'


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <BrowserRouter>
        <Nav />
        <Routes>
          <Route path="/src/components/CutData.js" element={<Item />} />
          <Route path="/src/components/Data.js" element={<Item />} />
        </Routes>
      </BrowserRouter>
      </header>
    </div>
  );
}

export default App;
